Ciao! Sono Ada 👩🏼‍⚕️,  l'assistente virtuale del tuo medico di base. Posso:
- fornirti contatti utili;
- darti delle informazioni sullo studio del medico (orari, posizione, tipo di visite mediche);
- offrirti un sistema di prenotazione, annullamento e modifiche delle visite mediche.

Il medico di base può rilasciare:
- prescrizioni di farmaci e di controlli specialistici; 
- certificati medici; 
e fare: 
- vaccinazioni;  
- tamponi rapidi;
- controlli di routine;
- visite domiciliari;
- visite a sportivi agonisti.

